// import logo from './logo.svg';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import { AgregarEstudiante, EditarEstudiante, ListaEstudiantes } from './estudiantes';


function App() {
  return (
    <div className="App">
      <h1>CRUD MERN stack</h1>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<ListaEstudiantes />} exact ></Route>
          <Route path='/agregarusuario' element={<AgregarEstudiante />} exact></Route>
          <Route path='/editarusuario' element={<EditarEstudiante />} exact></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
